    "https://api.themoviedb.org/3/movie/popular?api_key=2e0330200e928cadbc15cf3a8a2328dc&language=en-ES&page=1"
  );

  console.log(movies.result.total_pages);
  console.log(movies.result.total_results);
  console.log(movies.result.results);

  return <div>Estamos en home</div>;
};

export default Home;
